import yaml

def change_acc_lat(info):
    new_info = []
    for subnet in info:
        if len(subnet) == 2:
            new_info.append(subnet)
        else:
            new_subnet = [(subnet[0], subnet[1]), subnet[3], subnet[2]]
            new_info.append(new_subnet)
    return new_info

